    <div>
      <section>
        <h3 style={{ color: "white" }}>Welcome..! {reduxUser} </h3>
        <button onClick={logoutHandler}> Logout</button>
      </section>
      <section>
        <h3 style={{ color: "white" }}>Log Format</h3>
